import React, { Component } from 'react';

class Bin extends React.Component {
  constructor() {
    super();
    this.state = {
      numInside: 0
    };
  }
  render() {
    return (
      <div>
        <img src="/images/bin.jpg" />
      </div>
    );
  }
}

export default Bin;
